.swiper-container {
  width: 100%;
  height: 100%;
}
.svg-fon-orange {
  position: absolute;
  top: 0;
  right: -5%;
  z-index: -1;
}

.svg-fon-green {
  position: absolute;
  top: -25%;
  right: 0;
  z-index: -1;
}

.swiper-slide {
  display: flex;
  &-title {
    margin-top: 0;
    margin-bottom: 24px;
    font-weight: 700;
    font-size: 46px;
    line-height: 54px;
  }
  &-h2 {
    margin-bottom: 4px;
    font-weight: 600;
    font-size: 20px;
    line-height: 28px;
  }
  &-h3 {
    margin: 0 0 26px;
    font-family: "BebasNeue", Montsserat, Arial, Helvetica, sans-serif;
    font-size: 96px;
    line-height: 100%;
    letter-spacing: 0.02em;
    &-index {
      font-size: 100%;
      &__text {
        font-size: 24px;
      }
    }
  }
  &-text {
    margin: 0;
    font-size: 20px;
    line-height: 28px;
  }
  &-content {
    width: 80%;
    margin: 15vh auto 0;
    display: flex;
    justify-content: space-between;
  }
  &-block1 {
    width: 585px;
  }
  &-block2 {
    width: 350px;
  }
  &-btn {
    max-width: 290px;
    margin-top: 20px;
    padding: 20px 43px;
    font-weight: 600;
    font-size: 30px;
    line-height: 38px;
    background: transparent;
    border: 1px #fff solid;
    border-radius: 10px;
    color: $white;
    cursor: pointer;
    transition: 0.5s;
    &:focus,
    &:hover {
      outline: none;
      background: $light;
    }
  }
}
.swiper-pagination {
  top: 10vh;
  right: 35vw;
}
.swiper-pagination-bullet {
  width: 15px !important;
  height: 15px !important;
  background: $white !important;
  opacity: 1 !important;
  margin-right: 16px;
  outline: none;
  cursor: pointer;
}
.swiper-pagination-bullet-active {
  opacity: 1;
  background: $black !important;
}
.swiper-button-prev,
.swiper-button-next {
  color: $white !important;
  outline: none;
}

